import '../css/GetMemberById.css';
import PlanService from "../service/PlanService";

export class GetPlanById extends Component{
    constructor(props){
        super(props);
        this.state = {
            plans: []
        }
    }
    
    componentDidMount(){
        
        PlanService.getPlanById().then ((res) =>{
            console.log(res.data);
            this.setState({plans : res.data});
        })
    }

    render(){
        return(
            <>
