            //     <Link  to={"/addplans/"} class="dropdown-item" type="button">Add New Plan</Link>

            // </div>
            </div> */}
             <div className="row">
                <table className="table table-striped table-bordered">
                        <tr>
                            <th>Plan Id</th>
                            <th>Plan Name</th>
                            <th>Plan Start Date</th>
                            <th>Plan End Date</th>
                            <th>Plan Insured Amount</th>
                        </tr>   
                        <tbody>
                            {
                                 this.state.plans.map(
                                    Plan =>
                            <tr key={Plan.planId}>
                                <td>{Plan.planName}</td>
                                <td>{Plan.PlaneStartDate}</td>
                            </tr>
                                 )  

                            }
                        </tbody>                                   
                </table>
            </div></> 
            )
    }

}
